%% -----------------------------------------------------------------------------
  function PbInit_Callback(hObject,evendata)

    % Initializes processed data to initial data
    data.proc.T = data.init.T;
    data.proc.D = data.init.D;

    % Initializes processed data indices
    data.indices.NaN = [];
    data.indices.Int = [];

    % Plot data in the axes
    delete(handles.Line);
    handles.Line = plot(data.proc.T,data.proc.D,'b-','Parent',handles.AxPlot);

    % Update Toggle buttons pictures
    set(handles.TbDelNaN,'CData',Pics.DelNaN_R,'Value',0)
    set(handles.TbDelInt,'CData',Pics.DelInt_R,'Value',0)
    set(handles.TbShowProc,'Value',0)

    % Update Button Down Function for the axes
    set(handles.AxPlot,'ButtonDownFcn','')

    % Execute Toggle button callback for processed points display
    TbShowProc_Callback(hObject, '');

  end

%% -----------------------------------------------------------------------------
  function TbDelNaN_Callback(hObject,evendata)

    if get(hObject,'Value')

      % Update picture of the toggle button
      set(hObject,'CData',Pics.DelNaN_G)

      % Update state of the interp and Zoom toggle buttons
      set(handles.TbDelInt,'Value',0,'CData',Pics.DelInt_R);
      set(handles.TbZoom,'Value',0);
      
      % Disable Zoom
      zoom('off');

      % Update axes callback
      set(handles.AxPlot,'ButtonDownFcn',{@AxPlot_ButtonDownFcn,@delNaN_Callback});

    else

      % Update picture of the toggle button
      set(hObject,'CData',Pics.DelNaN_R)

      % Update axes callback
      set(handles.AxPlot,'ButtonDownFcn','');

    end

  end

%% -----------------------------------------------------------------------------
  function TbDelInt_Callback(hObject,evendata)

    if get(hObject,'Value')

      % Update picture of the toggle button
      set(hObject,'CData',Pics.DelInt_G)

      % Update state of the NaN and Zoom toggle buttons
      set(handles.TbDelNaN,'Value',0,'CData',Pics.DelNaN_R);
      set(handles.TbZoom,'Value',0);
      
      % Disable Zoom
      zoom('off');

      % Update axes callback
      set(handles.AxPlot,'ButtonDownFcn',{@AxPlot_ButtonDownFcn,@delInt_Callback});

    else

      % Update picture of the toggle button
      set(hObject,'CData',Pics.DelInt_R)

      % Update axes callback
      set(handles.AxPlot,'ButtonDownFcn','');

    end

  end

%% -----------------------------------------------------------------------------
  function TbShowProc_Callback(hObject,evendata)

    try
      delete(handles.ProcPts.Int);
      delete(handles.ProcPts.NaN);
    end

    if get(hObject,'Value')

      % Compute value displayed for NaN results
      NaNval = mean(data.init.D);

      handles.ProcPts.Int = plot(data.proc.T(data.indices.Int),data.proc.D(data.indices.Int),'o','MarkerSize',5,'MarkerFaceColor',[0 .8 0],'MarkerEdgeColor',[0 .8 0],'Parent',handles.AxPlot);
      handles.ProcPts.NaN = plot(data.proc.T(data.indices.NaN),repmat(NaNval,size(data.indices.NaN)),'o','MarkerSize',5,'MarkerFaceColor',[.8 0 0],'MarkerEdgeColor',[.8 0 0],'Parent',handles.AxPlot);

    else

      handles.ProcPts.Int = [];
      handles.ProcPts.NaN = [];

    end

  end


%% -----------------------------------------------------------------------------
  function TbZoom_Callback(hObject,evendata)
    
    if get(hObject,'Value')
      
      % Disable Processing Buttons
      set(handles.TbDelNaN,'Value',0,'CData',Pics.DelNaN_R);
      set(handles.TbDelInt,'Value',0,'CData',Pics.DelInt_R);
      
      % Update ButtonDown callback for the axes
      set(handles.AxPlot,'ButtonDownFcn','');
      
      zoom('on');
      
    else
      
      zoom('off');
      
    end
    
  end


%% -----------------------------------------------------------------------------
  function AxPlot_ButtonDownFcn(hObject,evendata,procFcn)

    % Get current point location on the axes
    point1 = get(hObject,'CurrentPoint');

    rbbox;

    point2 = get(hObject,'CurrentPoint'); % button up detected
    point1 = point1(1,1:2);                     % extract x and y
    point2 = point2(1,1:2);
    p1 = min(point1,point2);                    % calculate locations
    offset = abs(point1-point2);                % and dimensions
    xrange = [p1(1) p1(1)+offset(1)];
    yrange = [p1(2) p1(2)+offset(2)];

    hold('on');

    % Find points in the selected range
    ind1 = find((data.proc.T < xrange(2)) & (data.proc.T > xrange(1)));
    ind2 = find((data.proc.D < yrange(2)) & (data.proc.D > yrange(1)));

    % Find common points
    ind = intersect(ind1,ind2);

    % Process data with the appropriate function
    [proc,data.proc.D] = procFcn(data.proc.T,data.proc.D,ind);

    % Store processed indices
    data.indices.(proc) = union(data.indices.(proc),ind);

    % Update plot
    delete(handles.Line);
    handles.Line = plot(data.proc.T,data.proc.D,'b-','Parent',hObject);

    % Display processed data if needed
    TbShowProc_Callback(handles.TbShowProc,'');

  end


%% -----------------------------------------------------------------------------
  function [proc,ydata] = delNaN_Callback(xdata,ydata,ind)

    proc = 'NaN';
    ydata(ind) = NaN;

  end


%% -----------------------------------------------------------------------------
  function [proc,ydata] = delInt_Callback(xdata,ydata,ind)

    proc = 'Int';

    x = xdata;
    y = ydata;

    x(ind) = [];
    y(ind) = [];

    warning('off','MATLAB:interp1:NaNinY');
    ydata = interp1(x,y,xdata,'linear');
    warning('on','MATLAB:interp1:NaNinY');

  end

